def count_trees(a, right = 3, down = 1):
    tree = 0
    r = right
    for i in a[down::down]:
        if right >= 31:
            right -= 31
        if i[right] == "#":
            tree += 1
        right += r
    return tree

def mul_trees(a):
    right = [1, 3, 5, 7, 1]
    down = [1, 1, 1, 1, 2]
    tree = []
    pro = 1
    for i in zip(right, down):
        tree.append(count_trees(a, right = i[0], down = i[1]))
    for i in tree:
        pro *= i
    return pro

